import firstDog from "./img-react/dog-1.jpeg";
import secondDog from "./img-react/dog-2.jpeg";
import thirdDog from "./img-react/dog-3.jpeg";
function Blogs(props) {
  return (
    <div className="blogBoxes">
      <div className="box box-1">
        <img src={firstDog} alt="firstDog" height="400px" width="350px" />
        <h6>{props.date}</h6>
        <h4>{props.heading}</h4>
        <button className="light-btn">Read more</button>
      </div>
    </div>
  );
}
function App() {
  return (
    <div className="blogBoxes">
      <Blogs
        img=""
        date="24 Jan 2024"
        heading="Finding your perfect dog breed..."
      />
      <Blogs
        date="23 Jan 2024"
        heading="5 signs that it's time to change your dog's diet"
      />
      <Blogs date="21 Jan 2024" heading="Taking care of your dog's joints" />
    </div>
  );
}

export default App;
